import React from 'react';
import styled, {css} from 'styled-components';
import SectionTitle from "./SectionTitle";
import Paragraph from "./Paragraph";
import Team from "./Team";
import Video from "./Video";
import ImageFull from "./ImageFull";
import ImageSection from "./ImageSection"
import WeirdImageGrid from "./WeirdImageGrid";
import ImageTall from "./ImageTall";
import Column_Thin from "./Column_Thin";
import UnderLineSectionReverse from "./UnderLineSectionReverse";


const Wrapper = styled.section`
    align-item: start; 
    margin: 5% 0 5% 0;
    padding 0 5% 2% 5%;
`;
const Underline = styled.section`
    border-bottom-color: #cbcbcb;
    border-bottom-width: 1px;
    border-bottom-style: solid;
`;
// todo { image_section, blue_back, image_full, reverse
// todo image_tall image_grid image_half video
function getComponent(element) {
    if (element.section_title) {
        return <SectionTitle title={element.section_title}/>
    } else if (element.paragraph) {
        return <Paragraph text={element.paragraph}/>
    }else if(element.team){
        // <Team data={element.team}/>
        return null
    }else if(element.image_section){
        return <ImageSection image={element.image_section}/>
    }else if(element.image_full){
        return <ImageFull src={element.image_full}/>
    }else if(element.video){
        return <Video video={element.video}/>
    }else if(element.section_underline_reverse) {
        return <UnderLineSectionReverse image={element.section_underline_reverse}/>
    }
    // }else if(element.thin_column){
    //     return (<Column_Thin>{getComponent(element.thin_column)}</Column_Thin>)
    // }
}

const UnderLineSection = (props) =>(

    <Wrapper>
        <Underline>
            {props.data.map((o, index)=>{
                return getComponent(o);
            })}
        </Underline>
        </Wrapper>
)

export default UnderLineSection;
